INSERT INTO `t_question` VALUES (1,1,'工作不顺利','work','工作不顺心','2020-12-16 19:14:34',0),(2,1,'学习不顺心','school','学习不得劲','2020-12-16 19:14:34',0),(3,1,'劝告实习生，这些事情万万不能做。','work','在我第一次去实习的时候，很多事情我一直都弄不明白。为什么大家表面看起来关系都很好，但私底下他们总是互相吐槽？为什么大家总要我小心隔壁的小刘？他明明很nice啊？领导从什么时候知道了我要走的？我明明没有说呀？为什么昨天还在和我一起做项目的同事，今天就突然间走掉了？慢慢地，当我工作5年了以后，当我的角色转换从实习生变成了正式员工，再变成了老板。我才慢慢懂得了「实习生」这样一个角色需要承载的事务与定义。首先，我想先和大家说明「实习生」这样的角色究竟是为了做些什么？如果你还是一名在校大学生，你马上要去一家公司当实习生了，你究竟是要做些什么？「实习生」这样的岗位其实第一要务不是为了「完成工作」，主要任务有以下两个——1.学会接受「学生」到「职场人」这两种不同角色的转换。2.学习你的工作内容，直到成为「正式员工」。同时「实习生」有以下特权——1.学校的任务大于公司的任务，你永远拥有一个合理的理由：「学校有事」，因此可以无底线，疯狂地请假，但我个人不建议你这么做。2.工作不开心，你随时可以走人，并且你在实习生生涯里的一切工作选择与切换，并不会对你后续的求职带来太大的影响。3.别人对你的犯错容忍度极高，因为在他们看来，事实上你什么都不懂，你只要负责当一个乖巧懂事的小白兔，不要作死，慢慢学习就行了。但做一名优秀的「实习生」也是并不是这么简单的事情，因为学生时代我们有非常多的「陋习」需要及时去调整和改正。在这里，我写了9个需要注意的地方，如果你刚进入职场，或者马上要进入职场，请你抽出一点时间，好好看看——01 切忌话说得太满很多人不太懂，话说得太满，是一种什么概念？其实就是你把某件事情说死了，导致这件事情没有协商的余地了。具体是怎么表现呢？在协商之前就去下结论，没有回转空间；比如：客户：请问你们这份产品的报价是多少？实习生：30万。这只会导致两个结果:1.客户觉得报价高了，不联系你了；2.客户觉得价格便宜了，成交，你赚少了。而职场人会怎么去做呢？客户：请问你们这份产品的报价是多少？职场人：方便说一下您的预算么，我们根据不同的预算会给您推荐不同的产品和服务。客户：25W。职场人：好的，我们会和您推荐这样一套产品……不过我这边还是建议您再加5万预算，这样我们会有更好的服务和产品……客户：我最多只能再加2W预算。职场人：好的，我和老板申请一下…..（成交）你看，有经验的职场人会让结论让别人说出来，然后再根据自己或者公司的立场去协商。然后基于达成共识的前提去提升自己的利益。那什么是工作中的结论呢？其实就是三件事情：1.工作中项目责任的归属；2.客户报价的制定；3.评价一件事情。记住，这三件事情，谁先说，谁就输了。02 切忌推脱问题我们从小养成的习惯就是犯错了之后，第一时间找理由，或者推脱。但实际上，每家公司招募实习生，都会率先估计一个公司的容错率，以及给实习生的学习时间。实习生犯错其实并不可怕，因为实习生的大多数工作其实并不是核心的工作，你的犯错成本是可控的。所以你犯错了，不妨大方地承担。职场上犯错是不可避免的，想方设法的推脱，不如先学会「如何认错」。其实认错无非要完成这三件事情：1.主动认错；2.自我惩罚；3.补救措施。比如：小红给客户发错资料了，导致客户的收到的信息错误。那么小红应该第一时间找领导承认错误，然后给出的自我惩罚是不要当日的工资，补救措施是整理好正确的资料第一时间发给客户同时给客户道歉。记住，犯错了率先和领导坦白的成本永远比等被领导发现要来的低得多。03 合作切忌刻意离群，刻意合群有同学经常问我，要不要主动去融入公司环境。当然要。但不要迎合。什么是主动？主动是对邀请的积极参与和响应；什么是迎合？迎合是对他人的观点的曲意逢迎；比如：同事邀请你参与他们的聚餐和聚会？要不要去？想要融入，当然去，这是你积极想打入社交圈的表现。但如果同事在你面前背地里吐槽一个领导的好坏，并且问你对这位领导的意见，你要不要迎合他？如果你很喜欢这个领导，不用迎合他，保持沉默，听着就行。但你却可以和另外欣赏这位领导的同事们打好关系。听着，职场中的融入只要做到多数人不讨厌你，部分人喜欢并且欣赏你即可。所有社交的前提都是坚持一个完整并且真实的自我，让部分人喜欢即可。而不是为了迎合所有人，去做一个虚假的自己，这样你会活的很累。坚持自己最重要。04 切忌等别人给指导很多公司会有一个所谓的「职场导师」制度，说你刚进入公司，这位「导师」会帮助你成长。事实上，也就刚进入公司时，这位导师会跟你打个招呼，接下来可能直到你离职他都不会再出现。和在学校不一样，在职场中真的没有人会「义务」指导你。但我也不否认真的会遇到一些特别好的同事或者领导，他们会主动帮助你（比如我们公司）但大多数时候，工作上的学习都是靠你自己的。怎么去在职场上学习？1.靠模仿。我们总说，观察别人做事情，有些人心里是有谱的，什么是谱？你可以认为谱就是心里有一个表格，有一个进程表，该到什么时候，做什么事情，就打一个勾。谱，怎么来，就是观察，模仿。举个例子，去拜访客户的时候，需要准备什么资料？有什么固定的流程？具体要说哪些场面话？这些东西，我们先去仔细观察别的同事是怎么做的，然后收集好之后，是不是都可以做出一个ECXEL表格去记录一下，下次按照这个表格里面的步骤去递推就好了。2.换位思考，倒推经验你第一次遇到的问题，可能别人早已解决了N次了。其实做任何事情都是一样，我们总想着去解决一个问题，需要经验。经验从哪来呢？其实反过来，我们成为问题本身，找一个人解决掉我们，就能够获取到经验。比方说，接下来你要去完成客服的任务，处理一个公关问题。那怎么办？那你就去别的平台，成为一个刁难人的客户，看一下别的客服是怎么处理的，把他们的话术，语句，全部复制摘抄下来，成为你自己的。3.靠「交换」你会给什么样的人帮助？答案是：帮助过你的。反过来一样，你得给老同事一些甜头，人家才会帮你呀。先去「付出」再去「交换」资源，这是我大学就懂得的道理。你有什么资源？「劳动时间」「体力」「金钱」都可以。如果你有技能特长，你可以靠着「特长技能」去付出，然后再去交换资源。比如，我很擅长做PPT，你要我帮忙做PPT，可以，不收钱，那你下次要去客户要带着我。如果你没有什么技能特长，那就付出体力劳动交换也可以。多帮老同事做做PPT，处理下EXCEL表格，帮忙打印一下资料，帮忙拿个快递和外卖。别总是认为这些事情是浪费生命，实际上这也是在积累人脉和资源的一个过程。多热心一点吧，你会很快得到别人帮助作为回报的。实在不行，花一些小钱，去交换也可以。比如，以请教的姿态请老同事吃一顿饭。给周围的同事带一些小零食，点一两杯奶茶，搞好关系，下次遇到问题就可以去主动询问了。职场中的所有帮助，都是基于「价值交换」希望你牢牢记住这句话。05 切忌经验主义万岁我以前是一个很讨厌做表格的一个人。我做事情习惯了「遇到一个问题去解决一个问题」以及「个人英雄主义」。所以我做的很多事情都是基于我的过往经验。直到我手上的事情开始变多，变杂。我开始去让其他的同事去做事情了。很多问题开始浮现。第一，同事们担心犯错，束手束脚，越担心，越是犯错，总是过来不断的过来请教我，来回的时间成本耗时太大。第二，错误率暴增，不是漏了这个，就是漏了那个，项目进行到一半，经常要停滞去修补问题。从那个时候起，我发现，无论任何你做起来非常熟手的项目，甚至你觉得你闭着眼睛都能做的项目，你也要做一个SOP（Standard Operating Procedure）表。把一件事情要执行的标准操作步骤以统一的格式描述出来，然后一个一个地去对照，完成一个打一个勾，一个个查漏补缺。比如，我们公司每上架课程，就会让课程运营部门的同事，按照下列表格的要求，一个一个对照完成之后，才算是验收合格。06 切忌多嘴长舌你相信么？你在公司里面说的所有的话，都有可能被老板听见。同时，你的言行会一传十十传百的具有非常恐怖的蝴蝶效应。和大家讲个故事。王力口今天被开除了，因为他当众侮辱老板。但王力口一脸懵逼，我可从来没有骂过老板啊？怎么回事？同事A通过翻老板微博，翻出了一张老板的两岁时候的照片，然后保存到了手机里。同事A、B、C和王力口关系很好，他们有一次中午聚餐的时候，A把老板2岁时候的照片，翻出来给了王力口看。王力口看了之后哈哈大笑，“真像一头小猪。”C在玩手机没有留意，就问了B，“王力口说谁像小猪。”B说，“老板的照片。”C记住了这件事情，然后他在私底下和同事D、E、F的私底下KTV唱歌的时候，酒过三巡吐槽公司和同事八卦的时候，大嗬一声：“告诉你们一个秘密，王力口说老板长得像头猪！你们可千万别告诉其他人！”DEF听到之后，在各种聚餐场合，分别告诉了同事GHIJKLMN……“告诉你们一个秘密，王力口说老板长得像傻逼！你们可千万别告诉其他人！”慢慢地，版本就变成了“王力口说老板是个傻鸟……”“王力口说老板是缩头乌龟……”“王力口说老板是脑残……”全公司都知道了，王力口于是也被开除了。知道遇到这样的问题怎么办么？答案是：没办法，等死吧。诸葛亮从来不擅长包围之后怎么办，而只擅长如何不被包围。乖乖去下一家公司，牢牢记住以下十二个字。谨言慎行！谨言慎行！谨言慎行！07 切忌给老板思考题汇报领导给做决定的时候，别给领导思考题，请给选择题。比如，客户反映公司产品报价超预算了，这个时候该怎么办？如果你直接去问老板：“老板，客户反映公司产品报价超预算了，该怎么办？”那恭喜你，你就是个传话筒，你把思考问题这件事情成功地转交给了老板。你只会得到两个结果。1.老板有点不太爽你，然后要你调低报价和服务标准节省成本。2.老板有点不太爽你，然后回复你他要想想，然后就再也没有然后了……为什么要给老板选择题？因为老板真的很忙，你给他一个思考题，他大概率都是没有时间去做的。而你的答案如果能够帮助老板节省思考成本，那你会得到一个快速答复，会帮助你促进成交。所以如果是职场老手会怎么做呢？他会给一个有明显选择倾向的选择题。比如他其实是想完成这笔交易。那么他会设定一个明显比较好的答案A，和一个明显比较一般的答案B，然后同时递交给老板，促使老板选A。他会这样问老板：“老板，客户觉得报价有点高，我这边有两个方案请您定夺一下——A方案是我们降低10%的报价，然后我们同时也减少10%的服务，虽然营收少了，但是我们成本也低了，利润率是一样的。B方案是我们直接放弃这个客户。我个人建议A，因为这个客户背后有非常多的潜在客户资源，同时他也愿意帮助我们对外宣传。当然，我只是建议，最后还是要老板您做决定。”只要老板不是和那个客户有仇，闭着眼睛都会选A。实际上老手心理暗搓搓地帮老板做好选择了，表面上实际上是等老板定夺，只是走个形式让老板知道罢了。08 切忌情绪化情绪能力控制能力差的人，会容易以自我为中心，无论工作还是生活，只要让我不爽了，就都一边去。这是我最走心的一个建议——如果你想走到一个公司的较高的位置，除了技能之外，你一定要学会控制好自己的情绪。情绪控制能力的好坏，直接影响着你的抗压能力，而抗压能力的好坏，直接影响着你的工作重要程度。请一定要学会，就事论事。09 切忌不接受竞争问你一个问题：你觉得公司部门之间有竞争，部门之间经常争吵，你觉得合理吗？我的答案是，非常合理。一家优秀的公司，一定会存在良性的竞争，甚至优秀的领导者会用竞争来刺激公司的业务增长。怎么观察是否是良性的竞争？看他们吵的是什么？如果吵架是基于的是公司业务上的问题，指责对方做事不力或者利益不均，就属于良性竞争。作为实习生，那就去尽力帮助你的部门拿到竞争优势。如果吵架是基于对方个人生活，比如领导a指责领导b长相难看，或者领导b指责领导a身高太矮，那就纯粹属于傻逼公司。连领导都学不会对事不对人的傻逼公司，建议直接走人。最后，做个总结，实习生9大禁忌，请查收。1.切忌话说得太满；2.切忌推脱问题；3.切忌刻意离群，刻意合群4.切忌等别人给指导5.切忌经验主义万岁6.切忌多嘴长舌7.切忌给领导思考题8.切忌情绪化9.切忌不接受竞争希望各位能够在职场上越走越远。','2021-01-01 11:23:34',0),(11,1,'今天要去卡头耶','emotion','今天天气不错，适合去卡头耶','2021-02-01 11:15:23',0),(12,1,'职业道路弥漫','work','什么时候能有成绩','2021-02-01 11:17:16',0),(14,1,'测试wangeditor富文本编辑器','work','<h2 id=\"478se\">测试标题</h2><p><br/></p><p><b>测试加粗</b></p><p><font size=\"5\">测试字号</font></p><p>测试字体<font size=\"5\"><br/></font></p><p><i><font face=\"黑体\"></font>测试斜体</i><br/></p><p><u>测试下划线</u></p><p><strike>测试删除线</strike></p><blockquote><p>测试引用<strike><br/></strike></p></blockquote><p><img class=\"eleImg\" data-emoji=\"[舔屏]\" src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/40/pcmoren_tian_org.png\" alt=\"[[舔屏]]\"/>?<br/></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" width=\"206\" height=\"206\"/><br/></p><table border=\"0\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th></th><th></th><th><